tinymce.PluginManager.add('datofilemanager', function(editor, url) {
  editor.addButton('datofilemanager', {
    icon: "image",
    tooltip:"Insert file",
    shortcut:"Ctrl+E",
    onclick : function() {
    	 editor.windowManager.open({
			title : "File Manager",
			url : editor.settings.dato_filemanager_path,
			width : editor.settings.dato_dialog_width,
			height : editor.settings.dato_dialog_height,
		})
	}
  });
});